import Header from './header.js'

const layoutStyle = {
	margin: 20,
	padding: 20,
	border: '1px solid #DDD'
}

const layout = props =>  (
	<div style = {layoutStyle}>
		<Header/>
		{props.children}
	</div>
)
export default layout
